module Lex
# 1 "Lex.fsl"
 
// 词法分析
// 用下边的命令生成词法分析器Lex.fs
// dotnet "C:\Users\Administrator\.nuget\packages\fslexyacc\10.2.0\build\/fslex/netcoreapp3.1\fslex.dll"  -o "Lex.fs" --module Lex --unicode Lex.fsl

open FSharp.Text.Lexing
open Par  // Token 的定义位于语法分析模块中

// 辅助函数，从lexbuf 得到当前的 词元字符串，lexeme 
let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf


// 关键字
let keyword s =   
    match s with
    | "char"    -> CHAR
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "if"      -> IF
    | "int"     -> INT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "while"   -> WHILE
    | "loop"    -> LOOP
    | "switch"  -> SWITCH
    | "case"    -> CASE
    | "continue"-> CONTINUE
    | "break"   -> BREAK
    | "do"      -> DO
    | "for"     -> FOR
    | "in"      -> IN
    | "struct"  -> STRUCT
    | "string"  -> STRING
    | "try"     -> TRY
    | "catch"   -> CATCH
    | "throw"   -> THROW
    | _         -> NAME s   // 缺省情况，是标识符的名字，如 函数名，变量名等

// 字符串转义符处理函数
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

